import React, { Component } from 'react';
import TodoItem from '../TodoItem';

class TodoList extends Component {
  render() {
    const { todos, onToggle, onRemove } = this.props;
    const todoList = todos.map(
      todo => (
        <TodoItem
        
        >
          {todo.text}
         </TodoItem>
    )
    );

    return (
      <div>
        {todoList}
      </div>
    )
  }
}

export default TodoList;
